class Solution:
    def removeDuplicates(self, string: str, k: int) -> str:
        stack = []
        for letter in string:
            if len(stack) == 0 or letter != stack[-1][0]:
                stack.append([letter,1])
            else:
                stack[-1][1] += 1
            if stack[-1][1] == k:
                stack.pop()
        res = ''
        for l,v in stack:
            res += l*v
        return res

